import React from 'react';

const WelcomeSection = (props) => {
    return (
        <div className={`welcome-section section-dft ${props.services ? 'services' : 'home'}`}>
            <h1>{props.title}</h1>
            <h2>{props.subTitle}</h2>
        </div>
    )
}

export default WelcomeSection;
